// //public routes
// { path: '/login', isPublic: true, component: login },
// { path: '/forgot-password', isPublic: true },

// //authenticated routes
// { path: '/dashboard', component: dashboard }
import Dashboard from './pages/dashboard/Dashboard'

const routes = [
    {
        path: "/dashboard",
        name: "Dashboard",
        icon: "ni ni-chart-pie-35 text-info",
        component: Dashboard
    }, {
        collapse: true,
        name: "Test",
        state: "testCollapse",
        icon: "ni ni-chart-pie-35 text-info",
        views: [
            {
                path: "/test1",
                name: "Test 1",
                component: Dashboard,
            }, {
                path: "/test2",
                name: "Test 2",
                component: Dashboard,
            }
        ]
    }, {
        collapse: true,
        name: "Test",
        state: "test2Collapse",
        icon: "ni ni-chart-pie-35 text-info",
        views: [
            {
                path: "/test1",
                name: "Test 1",
                component: Dashboard,
            }, {
                path: "/test2",
                name: "Test 2",
                component: Dashboard,
            }
        ]
    }
]
export default routes;
